import React, { Component } from 'react';
import {Navbar,Nav,NavDropdown,Form,FormControl,Button} from 'react-bootstrap'
import './Header.css';

class Header extends Component {
    constructor() {
        super();

    }
    render() {
        return (
            <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
            {
              isLogged  ?

            (role === "employee" ? (
              <Navbar.Brand href="/employeeHome">
                <img src={jbemployee} width="330"/>
              </Navbar.Brand>
            ) : (
              <Navbar.Brand href="/employerHome">
                <img src={jbemployer} width="330" />
              </Navbar.Brand>
            ))
            :
              (
                key === "Employee" ?
                <Navbar.Brand href="/">
                <img src={jbemployee} width="230"/>
                </Navbar.Brand>
                :
                <Navbar.Brand href="/">
                <img src={jbemployer} width="230"/>
                </Navbar.Brand>
              )
            }

            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                { isLogged  ?
            (<Navbar.Collapse id="responsive-navbar-nav">
              <Nav className="mr-auto"></Nav>
              {role === "employee" ? (
                <Nav>
                  <Link to="/jobGuide">
                    <button className="buttonHome">Home</button>
                  </Link>
                  <Link to="/employeeDashboard">
                    <button className="buttonHome">Dashboard</button>
                  </Link>
                  <button className="buttonHome" onClick={logout}>
                    Logout
                  </button>
                </Nav>
              ) : (
                <Nav>
                <Link to="/postjob">
                  <button className="buttonHome">Home</button>
                </Link>
                <Link to="/employerDashboard">
                  <button className="buttonHome">Dashboard</button>
                </Link>
                <button className="buttonHome" onClick={logout}>
                  Logout
                </button>
              </Nav>
              )}
            </Navbar.Collapse>
            )
            :
             "" }
          </Navbar>
        )
    }
}


export default Header;
